import React from "react";
import Button from "@material-ui/core/Button";
import Dialog from "@material-ui/core/Dialog";
import Typography from "@material-ui/core/Typography";
import DialogTitle from "@material-ui/core/DialogTitle";
import DialogContent from "@material-ui/core/DialogContent";
import DialogActions from "@material-ui/core/DialogActions";
import { Current } from "../country/CountryCard";
import { Avatar } from "@material-ui/core";

interface WeatherInfoModalProps {
  open: boolean;
//   capitalWeatherInfo: Current;
  capitalWeatherInfo: Current;

  handleClose: () => void;
}

const WeatherInfoModal = (props : WeatherInfoModalProps) => {
    const { open, handleClose, capitalWeatherInfo } = props;
debugger
    return (
      <div>
        <Dialog
          onClose={handleClose}
          aria-labelledby="customized-dialog-title"
          open={open}
        >
          <DialogTitle id="customized-dialog-title">
            Weather Information
          </DialogTitle>
          <DialogContent dividers>
            <Typography variant="h4">{capitalWeatherInfo.name}</Typography>
            <Avatar
              variant="rounded"
              className={classes.rounded}
              src={capitalWeatherInfo.current.weather_icons[0]}
            />
            {capitalWeatherInfo.weather_icons?.map((weatherIcon) => {
              return (
                <img src={weatherIcon} key={weatherIcon} alt="weather_icons" />
              );
            })}
            <Typography variant="body1" color="textSecondary">
              Temperature : {capitalWeatherInfo.current.temperature + "°"}
            </Typography>
            <Typography variant="body1" color="textSecondary">
              Wind Speed : {capitalWeatherInfo.current.wind_speed} km/h
            </Typography>
            <Typography variant="body1" color="textSecondary">
              Precipitation : {capitalWeatherInfo.current.precip} %
            </Typography>

            {/* <Typography gutterBottom>
              Temperature - {capitalWeatherInfo.temperature}
            </Typography> */}
            {/* <Typography gutterBottom>
              Wind Speed - {capitalWeatherInfo.wind_speed}
            </Typography> */}
            {/* <Typography gutterBottom>
              Precip - {capitalWeatherInfo.precip}
            </Typography> */}
          </DialogContent>
          <DialogActions>
            <Button
              fullWidth
              variant="contained"
              autoFocus
              onClick={handleClose}
              color="primary"
            >
              OK
            </Button>
          </DialogActions>
        </Dialog>
      </div>
    );
};

export default WeatherInfoModal;
